b\u3002\u0020\u0029,\u0028\u0020\u2312\u006f\u2312\u0029\u4eba\u0028\u2312\u002d\u2312\u0020\u0029\u0076,\u30fd\uff08\u3000\uff3e\uff3e\uff09\u4eba\uff08\uff3e\uff3e\u3000\uff09\u30ce,\u30fd\u0028\u005e\u03c9\u005e\u0029\u4eba\u0028\u005e\u25bd\u3001\u005e\u0029\uff89,\u30fd\u0028\u002a\u005e\uff70\u005e\u0029\u4eba\u0028\u005e\uff70\u005e\u002a\u0029\u30ce,\u30fd\u0028\u2200\u309c\u0020\u0029\u4eba\u0028\u0020\u309c\u2200\u0029\u30ce,\u0028\u0e51\u0020\u204d\u0325\u0325\u0325\u1dc5\u0020\u1d08\u204d\u0325\u0325\u0325\u1dc5\u0029\u4eba\u0028\u204c\u0325\u0325\u0325\u1dc4\u03b5\u0020\u204c\u0325\u0325\u0325\u1dc4\u0020\u0e51\u0029\uff70,\u0028\uff61\u2022\u0020\u0300\u0434\u2022\u0301\u0029\u0020\u4eba\u0020\u0028\u2022\u0300\u03c9\u2022\u0301\u0020\u0029\uff8a\uff9e,\u30fe\u0028\u002a\u2312\u2207\u2312\u0029\u516b\u0028\u2312\u2207\u2312\u002a\u0029\u30c4,\u30fe\u0028\u25cf\uff65\uff56\uff65\u4eba\uff65\uff56\uff65\u25cb\u0029\uff89,\u30fe\u0028\u25cf\uff65\uff56\uff65\u4eba\uff65\uff56\uff65\u25cb\u0029\uff89,\u0028\u25bc\u25bd\u25bc\u0029\u4eba\u0028\u25bc\u25bd\u25bc\u0029,\u0028\u25cf\uff9f\u0076\uff9f\u0029\u4eba\u0028\uff9f\u0076\uff9f\u25cb\u0029\uff89,\u0028\u0076\u00b4\u2200\uff40\u0029\uff8a\u0028\u00b4\u2200\uff40\u0076\u0029,\u0028\u002a\u25cf\u03c9\u25cf\u0029\u4eba\u0028\u25cf\u03c9\u25cf\u002a\u0029,\u0028\u25cf\u309c\u25a1\u309c\u0029\u4eba\u0028\u309c\u25a1\u309c\u25cb\u0029,\u0028\u003d\u309c\u03c9\u309c\u0029\u4eba\u0028\u309c\u03c9\u309c\u003d\u0029,\u0028\u25cb\uff40\uff65\u30a7\uff65\u0029\u4eba\u0028\uff65\u30a7\uff65\u00b4\u25cf\u0029,\u0028\u0076\u3003\u2207\u3003\u0029\u30cf\u0028\u3003\u2207\u3003\u0076\u0029,\u0028\u266f\u309d\u03c9\u03c3\u266f\u0029\u4eba\u0028\uff0b\uff1e\u2200\uff1c\uff0b\u0029\u30ce,\u0028\uff0a\u00b4\u03c9\uff40\u4eba\u00b4\u2200\uff40\uff0a\u0029,\u30fd\uff08\u25cf\u00b4\u2200\uff40\uff09\u4eba\uff08\u00b4\u2200\uff40\u25cf\uff09\u30ce,\uff3c\u0028\u002a\uff40\u2200\u00b4\u0029\u4eba\u0028\uff40\u2200\u00b4\u002a\u0029\uff0f,\u0028\u25cf\u309d\u03c9\u0029\u30ce\u30fd\u0028\u2200\uff1c\u25cf\u0029,\u30fd\u0028\u0020\uff65\u2200\uff65\u0029\uff89\u005f\u03b8\u5f61\u2606\u03a3\u0028\u30ce\u0020\u0060\u0414\u00b4\u0029\u30ce,\u0028\u002a\u00b4\u2207\u0060\u0029\u250c\u03b8\u2606\u0028\uff89\u003e\u005f\u003c\u0029\uff89,\u0028\u0020\uffe3\u03c9\uffe3\u0029\u30ce\uff9e\u2312\u2606\uff90\u0028\u006f\u0020\u005f\u0020\u005f\u0029\u006f,\u0028\u002a\u0060\u0030\u00b4\u0029\u03b8\u2606\u0028\u30e1\u00b0\u76bf\u00b0\u0029\uff89,\u0028\u006f\u00ac\u203f\u00ac\u006f\u0020\u0029\u002e\u002e\u002e\u2606\uff90\u0028\u002a\u0078\u005f\u0078\u0029,\u0028\u256c\uffe3\u76bf\uffe3\u0029\u003d\u25cb\uff03\u0028\uffe3\u0023\u0029\uff13\uffe3\u0029,\u0028\u003b\u0020\u002d\u005f\u002d\u0029\u2015\u2015\u2015\u2015\u2015\u2015\u0043\u003c\u2015\u005f\u002d\u0029,\uff1c\u0028\u0020\uffe3\ufe3f\uffe3\u0029\ufe35\u03b8\ufe35\u03b8\ufe35\u2606\u0028\uff1e\u53e3\uff1c\uff0d\u0029,\u0028\uffe3\u03b5\u0028\u0023\uffe3\u0029\u2606\u2570\u256e\u006f\u0028\uffe3\u25bd\uffe3\u002f\u002f\u002f\u0029,\u30fd\u0028\u003e\u005f\u003c\u30fd\u0029\u0020\u2015\u2282\u007c\u003d\u0030\u30d8\u0028\u005e\u203f\u005e\u0020\u0029,\u30d8\u0028\u003e\u005f\u003c\u30d8\u0029\u0020\uffe2\u006f\u0028\uffe3\u203f\uffe3\uff92\u0029,\u002c\u002c\u0028\u0028\u0028\u0020\uffe3\u25a1\u0029\u005f\uff0f\u0020\uff3c\u005f\u0028\u25cb\uffe3\u0020\u0029\u0029\u0029\u002c\u002c,\u0028\u0482\u0060\u0020\uff9b\u0020\u00b4\u0029\ufe3b\u30c7\u2550\u4e00\u0020\uff3c\u0028\u00ba\u0020\u25a1\u0020\u00ba\u0020\u006c\u007c\u006c\u0029\u002f,\u0028\u256f\u00b0\u0414\u00b0\u0029\u256f\ufe35\u0020\u002f\u0028\u002e\u25a1\u0020\u002e\u0020\uff3c\u0029,\u0028\u00ac\u005f\u00ac\u0027\u0027\u0029\u0505\u0028\uffe3\u03b5\uffe3\u0505\u0029,\u002f\u0028\u0020\u002e\u25a1\u002e\u0029\uff3c\u0020\ufe35\u2570\u0028\u00b0\u76ca\u00b0\u0029\u256f\ufe35\u0020\u002f\u0028\u002e\u25a1\u002e\u0020\u002f\u0029,\u0028\uff89\u002d\u002e\u002d\u0029\uff89\u2026\u002e\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u25cf\u007e\u002a\u0020\u0028\u0020\u003e\u005f\u003c\u0029,\u0021\u0021\u0028\uff92\uffe3\u0020\uffe3\u0029\u005f\u03b8\u2606\u00b0\u0030\u00b0\u0029\u002f,\u0028\u0060\u2312\u002a\u0029\u004f\u002d\u0028\u0060\u2312\u00b4\u0051\u0029,\u0028\u0028\u0028\u0e07\u2019\u03c9\u2019\u0029\u0648\u4e09\u0020\u0e07\u2019\u03c9\u2019\u0029\u06a1\u2261\u3000\u2606\u2312\uff90\u0028\u0028\u0078\u005f\u0078\u0029,\u0028\u0e07\u0ca0\u005f\u0ca0\u0029\u0e07\u3000\u03c3\u0028\u0020\u2022\u0300\u0020\u03c9\u0020\u2022\u0301\u0020\u03c3\u0029,\u0028\u3063\u2022\ufe4f\u2022\u0029\u3063\u0020\u2734\u003d\u003d\u2261\ub208\u0669\u0028\u0060\u76bf\u00b4\u0482\u0029\u0e07,\u0028\uff62\u2022\u0020\u03c9\u0020\u2022\u0029\uff62\u0020\u0028\u2312\u03c9\u2312\u0060\u0029,\u0028\u0020\u00b0\u1d17\u00b0\u0029\u007e\u00f0\u0020\u0028\u002f\u275b\u006f\u275b\u005c\u0029,\u0028\u0020\u30fb\u2200\u30fb\u0029\u30fb\u30fb\u30fb\u002d\u002d\u002d\u002d\u002d\u002d\u002d\u002d\u2606,\u0028\u002f\u002d\u005f\u30fb\u0029\u002f\u0044\u30fb\u30fb\u30fb\u30fb\u30fb\u002d\u002d\u002d\u002d\u002d\u002d\u0020\u2192,\u0028\u005e\u03c9\u005e\u0029\u30ce\uff9e\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u0028\u25cf\uff5e\u002a,\u0028\u0020\u002d\u03c9\u002d\u0029\uff0f\u5360\u007e\u007e\u007e\u007e\u007e,\u0028\u002f\u30fb\u30fb\u0029\u30ce\u3000\u3000\u0020\u0028\u0028\u0020\u304f\u0020\u0028\u0028\u3078,\u2015\u2282\u007c\u003d\u0030\u30d8\u0028\u005e\u005e\u0020\u0029,\u25cb\u221e\u221e\u221e\u221e\u30fd\u0028\u005e\u30fc\u005e\u0020\u0029,\u0028\u003b\u0020\u30fb\u005f\u30fb\u0029\u2015\u2015\u2015\u2015\u0043,\u0028\u0ca0\u0020\u006f\u0020\u0ca0\u0029\u00a4\u003d\u005b\u005d\u003a\u003a\u003a\u003a\u003a\u003e,\u0028\u002a\uff3e\uff3e\u0029\u002f\u007e\u007e\u007e\u007e\u007e\u007e\u007e\u007e\u007e\u007e\u25ce,\uffe2\u006f\u0028\uffe3\u002d\uffe3\uff92\u0029,\u2015\u0028\u0054\u005f\u0054\u0029\u2192,\u0028\u0028\u0028\u0020\uffe3\u25a1\u0029\u005f\uff0f,\u0028\uff92\u0060\u0020\uff9b\u0020\u00b4\u0029\ufe3b\u30c7\u2550\u4e00,\u0028\u0020\u00b4\u002d\u03c9\uff65\u0029\ufe3b\u253b\u2533\u2550\u2550\u2501\u4e00,\u0028\uff92\uffe3\u25bd\uffe3\u0029\ufe3b\u2533\u2550\u4e00,\u2734\u003d\u003d\u2261\ub208\u0669\u0028\u0060\u76bf\u00b4\u0482\u0029\u0e07,\u0051\u0028\u0060\u2312\u00b4\u0051\u0029,\u0028\u30ce\u0020\u02d8\u005f\u02d8\u0029\u30ce\u3000\u03b6\u007c\u007c\u007c\u03b6\u3000\u03b6\u007c\u007c\u007c\u03b6\u3000\u03b6\u007c\u007c\u007c\u03b6,\u0028\uff89\u2267\u2200\u2266\u0029\uff89\u0020\u2025\u2026\u2501\u2501\u2501\u2605,\u0028\uff89\u003e\u03c9\u003c\u0029\uff89\u0020\u003a\uff61\uff65\u003a\u002a\u003a\uff65\uff9f\u2019\u2605\u002c\uff61\uff65\u003a\u002a\u003a\uff65\uff9f\u2019\u2606,\u0028\u30ce\u00b0\u2200\u00b0\u0029\u30ce\u2312\uff65\u002a\u003a\u002e\uff61\u002e\u0020\u002e\uff61\u002e\u003a\u002a\uff65\u309c\uff9f\uff65\u002a\u2606,\u2570\u0028\u0020\u0361\u00b0\u0020\u035c\u0296\u0020\u0361\u00b0\u0020\u0029\u3064\u2500\u2500\u2606\u002a\u003a\u30fb\uff9f,\u0028\uff03\uffe3\u25a1\uffe3\u0029\u006f\u2501\u2208\u30fb\u30fb\u2501\u2501\u2501\u2501\u2606,\u0028\u2283\uff61\u2022\u0301\u203f\u2022\u0300\uff61\u0029\u2283\u2501\u273f\u273f\u273f\u273f\u273f\u273f,\u0028\u2229\u1111\u005f\u1111\u0029\u2283\u2501\u2606\uff9f\u002a\uff65\uff61\u002a\uff65\u003a\u2261\u0028\u0020\u03b5\u003a\u0029,\u0028\u002f\uffe3\u30fc\uffe3\u0029\u002f\u007e\u007e\u2606\u2019\u002e\uff65\u002e\uff65\u003a\u2605\u2019\u002e\uff65\u002e\uff65\u003a\u2606,\u0028\u2229\u0060\u0020\uff9b\u0020\u00b4\u0029\u2283\u2501\u708e\u708e\u708e\u708e\u708e,\u0028\u2229\u005e\u006f\u005e\u0029\u2283\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u3002\u30fb\u03c9\u30fb\u0029\uff1d\u300a\u300a\u2260\u2260\u2260\u2260\u2260\u2260\u2260\u2260\u3007,\u0028\u2229\u0020\u0361\u00b0\u0020\u035c\u0296\u0020\u0361\u00b0\u0029\u2283\u2501\u273f\u273f\u273f\u273f\u273f\u273f,\u2729\u00b0\uff61\u22c6\u2e1c\u0028\u0942\u02d9\ua4b3\u0020\u02d9\u0020\u0029,\u006f\u0361\u0361\u0361\u256e\u0f3c\u0020\u0ca0\u0414\u0ca0\u0020\u0f3d\u256d\u006f\u0361\u0361\u0361\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u25cb\u00b4\uff65\u2200\uff65\u0029\u006f\u003c\uff65\u3002\u003a\u002a\uff9f\u003b\u002b\uff0e,\u2729\u00b0\uff61\u22c6\u2e1c\u0028\u0942\u02d9\ua4b3\u200b\u02d9\u0020\u0029,\u1566\u0028\u0020\u273f\u0020\u2299\u0020\u035c\u0296\u0020\u2299\u0020\u273f\u0020\u0029\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u2229\u0020\u0361\u00b0\u0020\u035c\u0296\u0020\u0361\u00b0\u0029\u2283\u2501\u2606\uff9f,\u0f3c\u2229\u273f\u0644\u035c\u273f\u0f3d\u2283\u2501\u2606\uff9f\u002e\u0020\u002a\u0020\uff65\u0020\uff61\uff9f,\u0028\u2229\uff61\uff65\uff4f\uff65\uff61\u0029\u3063\u002e\uff9f\u2606\uff61\u0027\u0060,\u30fd\u0f3c\u0e88\u0644\u035c\u0e88\u0f3d\u2283\u2500\u2606\u002a\u003a\u30fb\uff9f,\u0028\u2606\u005f\u30fb\u0029\u30fb\u2025\u2026\u2501\u2501\u2501\u2605,\u2570\u0028\u0020\u0361\u00b0\u0020\u035c\u0296\u0020\u0361\u00b0\u0020\u0029\u3064\u2500\u2500\u2606\u002a\u003a\u30fb\uff9f,\u2606\u0028\uff89\u005e\u03c9\u005e\u0029\uff89\u2025\u2025\u2025\u2026\u2501\u2501\u2501\u2501\u3007\u3000\u0028\u005e\u039f\u005e\u0029,\u0028\u03c3\u00b4\u0414\uff40\u0029\u03c3\u30fb\u30fb\u30fb\u30fb\u2026\u2501\u2501\u2501\u2501\u2606,\u220b\u0028\u3002\u30fb\u201d\u30fb\u0029\u005f\u2020\u003a\u002a\u002e\u003b\u201d\u002e\u002a\u30fb\u003b\u30fb,\u0028\uff89\u25d5\u30ee\u25d5\u0029\uff89\u002a\u003a\uff65\uff9f\u2727,\u0f3c\u2229\u2609\u0644\u035c\u2609\u0f3d\u2283\u2501\u2606\uff9f\u002e\u0020\u002a\u0020\uff65\u0020\uff61\uff9f,\u0028\u3064\u25d5\u0c6a\u25d5\u0029\u3064\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u002a\uff40\u25a1\u0029\u003c\u708e\u708e\u708e\u708e,\uff1d\uff1d\uff1d\uff1d\u2606\u2523\u006f\u0028\u00b4\u0028\uff10\uff10\u0029\uff40\u0020\u0029,\u2606\u2501\u2501\u2501\u2501\u2501\u2501\u2026\u2025\u002a\uff1a\uff65\u2020\u005f\u0028\u2018\uff70\u2019\u002a\u0029\u03b2,\u002e\u0020\u002a\u0020\uff65\u0020\uff61\uff9f\u2606\u2501\u0a67\u0f3c\u0020\u2022\u0301\u0020\u30ee\u0020\u2022\u0300\u0020\u0f3d\u0b68,\u0028\u0060\uff65\u0414\uff65\u0029\u30ce\u003d\u2606,\u2570\u0028\u0020\u00b4\u30fb\u03c9\u30fb\u0029\u3064\u2500\u2500\u2606\u273f\u273f\u273f,\u0028\u2283\uff61\u2022\u0301\u203f\u2022\u0300\uff61\u0029\u2283\u2501\u273f\u273f\u273f\u273f\u273f\u273f,\u2570\u0028\u0020\u2070\u0020\u0a0a\u0020\u2070\u0020\u0029\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u0a6d\u02ca\u0348\u0020\ua4b5\u02cb\u0348\u0029\u0a6d\u0338\u002a\u2727\u207a\u02da,\u0028\u0020\u00b0\u002d\u00b0\u0029\u30b7\u0020\u30df\u2605\u0020\u30df\u2606,\u007e\u25cf\u0029\u0029\u0029\u0029\u0029\u2606\u042e\u0028\uffe3\u30fc\uffe3\u002a\u0029,\u0a6d\u2022\u0300\u03c9\u2022\u0301\u0029\u0a6d\u0338\u002a\u2729\u207a\u02da,\u0f3c\u0028\u2229\u0020\u0361\u00b0\u256d\u035c\u0296\u256e\u0361\u0020\u0361\u00b0\u0029\u0f3d\u2283\u2501\u2606\uff9f\u002e\u0020\u002a\u0020\uff65\u0020\uff61\uff9f,\u0028\u3063\u30fb\u03c9\u30fb\uff09\u3063\u2261\u2261\u2261\u2261\u2261\u2261\u2606,\u2570\u0028\u2022\u0300\u0020\u0033\u0020\u2022\u0301\u0029\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u2729\u00b0\uff61\u22c6\u2e1c\u0028\u0942\uff61\u2022\u03c9\u2022\uff61\u0029,\u0028\u2229\uff40\u002d\u00b4\u0029\u2283\u2501\u273f\u273f\u273f\u273f\u273f\u273f,\u0f3c\u2229\u0020\u2022\u0301\u0020\u30ee\u0020\u2022\u0300\u0020\u0f3d\u2283\u2501\u2606\uff9f\u002e\u0020\u002a\u0020\uff65\u0020\uff61\uff9f,\u0028\u2229\uff40\u002d\u00b4\u0029\u2283\u2501\u708e\u708e\u708e\u708e\u708e,\u0021\u0021\u0028\u002a\uff89\u00b4\u2200\uff40\u0029\uff89\u2025\u2025\u2026\u2501\u2501\u2501\u2501\u2501\u2606,\u0b2a\u0028\u2688\u1dc9\u0299\u2688\u1dc9\u0029\u0a6d\u0338\u0b6b\u0d66\u20db,\u0028\u251b\uff40\u0414\u00b4\u0029\u251b\u30fb\u2025\u2026\u2501\u2501\u2501\u2605\u0029\u00b4\u2200\uff40\uff89,\u0f3c\u3064\u0ca0\u76ca\u0ca0\u0f3d\u3064\u0020\u2500\u003d\u2261\u03a3\u004f\u0029\u0029,\u0028\u002a\u2019\u25bd\u2019\u0029\u30ce\uff3e\u2014\u003d\u003d\u039e\u039e\u039e\u2606,\u0028\u002a\u2019\u25bd\u2019\u0029\u30ce\uff3e\u2014\u003d\u003d\u039e\u039e\u039e\u273f\u273f\u273f\u273f\u273f,\u2605\u2261\u2261\uff3c\uff08\u0060\u25b3\u00b4\uff3c\uff09,\u708e\u708e\u708e\u708e\u2606\u2523\u006f\u0028\uff65\u03c9\uff65\u0020\u0029,\u0028\u0a6d\u2022\u0300\u03c9\u2022\u0301\u0029\u0a6d\u0338\u002a\u2729\u207a\u02da,\u0028\u03c3\u0027\u2200\u0027\u0029\u03c3\u002a\u3002\u30fb\u309c\u002b\u002e\u002a,\u0028\u002d\u005f\u002d\u0029\u007e\u007e\u007e\u25cb\u2501\u2501\u2501\u2501\u2501\u2606\u0029\uff9f\u004f\uff9f\u0029,\u0028\uff89\u2267\u2200\u2266\u0029\uff89\u30fb\u2025\u2026\u708e\u708e\u708e\u708e\u708e\u708e\u708e\u708e,\u0028\u2229\uff40\u002d\u00b4\u0029\u2283\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u2606\uff9f\uff65\u002a\u003a\u002e\uff61\u002e\u2606\u2020\u005f\u0028\uff9f\u25bd\uff9f\u002a\u0029\u03b2,\u0028\u002a\uff9f\u30fc\u005e\u0029\u002f\u0027\u0060\u002a\u003a\u002c\uff0e\u2605,\u0028\u0a6d\u2022\u0300\u03c9\u2022\u0301\u0029\u0a6d\u0338\u002a\u708e\u708e\u708e\u708e\u708e\u708e\u708e,\u0028\uff20\u30fb\uff40\u03c9\u30fb\u0029\u0076\u30fb\u30fb\u30fb\uff0e\uff0e\uff0e\u2026\u2501\u2501\u2501\u2606,\u002a\u007e\u25cf\u0029\u0029\u0029\u0029\u2606\u004f\u003d\u0028\u0060\u005f\u0060\u0020\u0029,\uffe1\u0028\u002a\u2019\u03bf\u2019\uff09\u002f\u2606\u002a\u3002\u002b\uff0c,\u0028\u251b\uff40\u0414\u00b4\u0029\u251b\u30fb\u2025\u2026\u708e\u708e\u708e\u708e\u708e\u708e\u708e,\u30fd\u0f3c\u0e88\u0644\u035c\u0e88\u0f3d\u2283\u2500\u708e\u708e\u708e\u708e\u708e\u708e\u708e\u708e,\u0028\u2283\uff61\u2022\u0301\u203f\u2022\u0300\uff61\u0029\u2283\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f,\u0028\u2229\u005e\u006f\u005e\u0029\u2283\u2501\u2606\u309c\u002e\u002a,\u0028\u3064\u02f5\u2022\u0301\u03c9\u2022\u0300\u02f5\u0029\u3064\u2501\u2606\uff9f\u002e\u002a\uff65\uff61\uff9f\u0489\u031b\u0f3d\u0328\u0489\u0489\uff89,\u0028\u0020\u25d4\u0020\u0c6a\u25d4\u0029\u2283\u2501\u2606\uff9f\u002e\u002a\u30fb,\u0b2a\u0028\u2688\u1dc9\u0299\u2688\u1dc9\u0029\u0a6d\u0338\u0b6b\u708e\u708e\u708e\u708e\u708e\u708e\u708e,\u0028\uff89\u2267\u2200\u2266\u0029\uff89\u30fb\u2025\u2026\u2501\u2501\u2501\u2605,\u5f61\uff9f\u25c9\u03c9\u25c9\u0020\u0029\u3064\u30fc\u2606\u002a,\u0028\u3063\u02d8\u06a1\u02d8\u03c2\u0029,\u0028\u0020\u006f\u02d8\u25e1\u02d8\u006f\u0029\u0020\u250c\u0069\u0069\u0069\u2510,\u0028\u3000\u2019\u03c9\u2019\u0029\u65e6\u007e\u007e,\u0028\u0020\u02d8\u25bd\u02d8\u0029\u3063\u2668,\u2668\u006f\u0028\u003e\u005f\u003c\u0029\u006f\u2668,\u0028\u0020\u30fb\u03c9\u30fb\u0029\u006f\u002d\u007b\u007b\u005b\u3003\u005d\u007d\u007d,\u0028\u3000\u30fb\u03c9\u30fb\u0029\u2283\u002d\u005b\u4e8c\u4e8c\u005d,\u0028\u0020\u30fb\u30fb\u0029\u3064\u2015\u007b\u007d\u0040\u007b\u007d\u0040\u007b\u007d\u002d,\u0028\u0020\u30fb\u30fb\u0029\u3064\u002d\u25cf\u25cf\u25cf,\u0028\u002a\u00b4\u30fc\u0060\u0029\u65e6\u0020\u65e6\u0028\uffe3\u03c9\uffe3\u002a\u0029,\u0028\u002a\u00b4\u0437\u0060\u0029\u53e3\uff9f\uff61\uff9f\u53e3\u0028\u30fb\u2200\u30fb\u0020\u0029,\u0028\u0020\u006f\u005e\u0020\u005e\u006f\u0029\u4e14\u0020\u4e14\u0028\u00b4\u03c9\u0060\u002a\u0029,\u0028\u0020\uffe3\u25bd\uffe3\u0029\u005b\u005d\u0020\u005b\u005d\u0028\u2267\u25bd\u2266\u0020\u0029,\u0028\u0020\u002a\u005e\u005e\u0029\u006f\u2200\u002a\u2200\u006f\u0028\u005e\u005e\u002a\u0020\u0029,\u0028\u0020\u005e\u005e\u0029\u005f\u65e6\u007e\u007e\u3000\u0020\u007e\u007e\u0055\u005f\u0028\u005e\u005e\u0020\u0029,\u0028\u002a\uffe3\u25bd\uffe3\u0029\u65e6\u0020\u4e14\u0028\u00b4\u2200\u0060\u002a\u0029,\u002d\u25cf\u25cf\u25cf\u002d\uff43\u0028\u30fb\u30fb\u0020\u0029,\u0028\u0020\u30fb\u30fb\u0029\u3064\u2015\u25cf\u25cb\u25ce\u002d,\u25e5\u2588\u0306\u0308\u25e4\u0fc9\u2225\u002d,\u0028\u22c6\u203f\u22c6\u0029\u002d,\ua29e\u0329\u204c\u2022\u0361\u02fb\u2022\u204d\u1d52\u1d48\u1d43\u207f\u1d4d\u1d52\u0020\u207f\u1d49,\u2113\u0020\u03da\u03e6\u03bf\u03c2\u04e7\u053c\u0571\u03ee\u03f5\u20db,\uff08\uffe3\uff57\uffe3\uff09\u03a8,\u304f\u30b3\uff1a\u5f61\uff61\u2260\u0028\uffe3\uff5e\uffe3\u0020\u0029\u002d,\u0028\u25cf\u00b4\u0437\u2015\u2501\u2501\u2501\u03b5\uff40\u25cf\u0029,\u0028\u25bc\u0434\u25bc\u0029\u006f\u002d\u007b\u007b\u005b\u3003\u005d\u007d\u007d,\u0028\u0020\u30fb\u30fb\u0029\u3064\u2015\u007b\u007d\u0040\u007b\u007d\u0040\u007b\u007d\u002d,\u0028\u0020\u30fb\u30fb\u0029\u3064\u002d\u25cf\u25cf\u25cf,\u2015\u25cf\u25cb\u25ce\u002d,\u0028\u3000\u00b4\u2200\uff40\u0029\u3064\u2015\u25cf\u25cb\u25ce\u002d\u002d,\u266a\u006f\u0028\u0020\u00b4\u2200\uff40\u0029\u3063\u250c\u0069\u0069\u0069\u2510,\u0028\u002a\uff65\u2200\uff65\u0029\u005f\u03a9\u007e,\u0028\u002a\uff9f\u0414\uff9f\u0029\u3064\u002d\u004f\uff9b\u007c\u003e\u002d,\u30fd\u007c\u3002\u00b4\u30a7\uff40\u007c\uff89\u0020\u2015\u25a0\u25cf\u25b2,\u0028\u3000\u30fb\u03c9\u30fb\u0029\u2283\u002d\u005b\u4e8c\u4e8c\u005d,\u002d\u25cf\u25cf\u25cf\u002d\uff43\u0028\u03c9\uff40\uff43\u0020\u0029,\u2015\u2282\u005a\u005a\u005a\u2283,\u0295\u0020\u0ca1\u0020\ufe4f\u0020\u0ca1\u0020\u0294\u2283\u2015\u007b\u007d\u0040\u007b\u007d\u0040\u007b\u007d\u002d,\u0028\u3000\u30fb\u03c9\u30fb\u0029\u2283\u002d\u005b\u4e8c\u003e\u0020\u003e\u4e8c\u005d\u002d\u2282\u0028\u00b4\u2200\uff40\u0020\u0029,\u003e\uff9f\u0029\u0023\u0023\u0029\u5f61\uff43\u0028\uff61\uff65\u30a7\uff65\uff61\u0029\u3063\u2501\u0020\u003c\u30b3\uff1a\u5f61\u2501,\u2606\uff90\u0028\u006f\u002a\uff65\u03c9\uff65\u0029\uff89,\u0043\u003d\u0020\u0043\u003d\u0020\u0043\u003d\u0020\u0043\u003d\u0020\u0043\u003d\u250c\u0028\u003b\u30fb\u03c9\u30fb\u0029\u2518,\u2500\u003d\u2261\u03a3\u0028\u0028\u0028\u0020\u3064\uff1e\uff1c\u0029\u3064,\u03b5\u003d\u03b5\u003d\u03b5\u003d\u03b5\u003d\u250c\u0028\u003b\uffe3\u25bd\uffe3\u0029\u2518,\u03b5\u003d\u03b5\u003d\u250c\u0028\u0020\u003e\u005f\u003c\u0029\u2518,\u0043\u003d\u0020\u0043\u003d\u0020\u0043\u003d\u0020\u0043\u003d\u250c\u0028\u0020\u0060\u30fc\u00b4\u0029\u2518,\u03b5\u003d\u003d\u003d\u0028\u3063\u2267\u03c9\u2266\u0029\u3063,\u30fd\u0028\uffe3\u0434\uffe3\u003b\u0029\u30ce\u003d\u0033\u003d\u0033\u003d\u0033,\u3002\u3002\u3002\u30df\u30fd\u0028\u3002\uff1e\uff1c\u0029\u30ce,\u0669\u0028\u0948\u0020\u0300\u0020\u0e54\u0e34\u0020\u0301\u0020\u0029\u06f6\u0f34\u0020\u207c\u00b3\u208c\u2083,\u0ac3\u0028\u00f3\u02f3\u00f2\u0020\u0ac3\u0029\u055e\u232f\u025c\u025c\u025c,\u4e09\u0028\u534d\u0020\u02d8\u03c9\u02d8\u0029\u0029\u534d,\u10e6\u0028\u25d4\u06bc\u25d4\u10e6\u0029\u30df,\u09eb\u0028\u201d\u0693\u09eb\u0029\u02d2\u02d2\u02d2\u02d2,\u03a3\u0028\u309c\u30ef\uff9f\u2282\u0029\u2261\u2261\u2261\u0437\u0437\u0437,\u0021\u0021\u03a3\u0028\u309c\u30ef\uff9f\u2282\u0029\u2261\u2261\u2261\u0437\u0437\u0437,\u003d\u035f\u035f\u035e\u035e\u25ce\u0028\u25ce\u0020\u005e\u006f\u005e\u0029\u25ce,\u02f9\u207d\u02c6\u2070\u02c6\u02fa\u0020\u207e\u02fa\u02be\u02be\u02be\u02be,\u02bf\u02bf\u02bf\u02bf\u02f9\u207d\u0020\u02f9\u02c6\u2070\u02c6\u207e\u02fa,\uff08\uff08\uff08\uff08\uff08\uff08\uff08\uff08\u3000\u309c\u25a1\u309c\uff09\u30ce,\u2501\u0020\u003d\u035f\u035f\u035e\u035e\u0028\u0e4f\u0e49\u2653\u0e4f\u0e49\u0029,\u002a\u002a\u0020\u003d\u035f\u035f\u035e\u035e\u0028\u0e07\ua3ff\u1dc5\u0ae9\ua3ff\u1dc4\u0029\u0e07\u207c\u00b3\u208c\u2083,\u0669\ubbb9\u06f6\u207c\u00b3\u208c\u2083,\u0028\u0f0e\u0eb4\u1fc0\u032b\u0020\u0f0e\u0eb4\u0020\u0328\u0020\u0029\u035e\u02ed\u0333\u0333\u0333\u02ed\u0333\u0333\u0333\u02cd\u033f\u033f\u02cd\u033f\u02cc\u02f3\u02cf\u0307\u22c5\u2234\u0f23,\u0028\u0f20\u0c6a\u0f20\u0020\u0328\u0020\u0029\u035e\u02ed\u0333\u0333\u0333\u02ed\u0333\u0333\u0333\u02cd\u033f\u033f\u02cd\u033f\u02cc\u02f3\u02cf\u0307\u22c5\u2234\u0f23,\ubbbb\u207c\u00b3\u208c\u2083,\u006f\u0028\uffe3\uff65\uff65\uffe3\u006f\u0029\u0029\u0029\u003d\u0033,\uff08\u00b4\u25a1\uff40\uff1b\uff09\u003d\u0417\u003d\u0417\u003d\u0417\u003d\u0417\u003d\u0417\u003d\u0417,\u03b5\uff1d\u006f\u0028\u002a\u2019\u25e1